import React from "react";
import "./App.css";
import { SignUp, Form, Copyright } from "./components/sample";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import { Header } from "./components/Header";
import { CardN } from "./components/Card";
import { BasicGrid } from "./components/test";
function App() {
  return (
    <div>
      <Router>
        {/* Nav bar start */}
        <Header />
        {/* Nav bar end */}
        <Routes>
          <Route path="/" element={<div>WELCOME</div>} />
          <Route path="/signup" element={<SignUp />} />
          <Route path="/form" element={<Form />} />

          <Route
            path="/card"
            element={
              <CardN
                data={[
                  {
                    name: "Name 1",
                    mobile: 9000000001,
                    address: "Address 1",
                  },
                  {
                    name: "Name 2",
                    mobile: 9000000002,
                    address: "Address 2",
                  },
                  {
                    name: "Name 3",
                    mobile: 9000000003,
                    address: "Address 3",
                  },
                  {
                    name: "Name 4",
                    mobile: 9000000004,
                    address: "Address 4",
                  },
                  {
                    name: "Name 5",
                    mobile: 9000000005,
                    address: "Address 5",
                  },
                  {
                    name: "Name 6",
                    mobile: 9000000006,
                    address: "Address 6",
                  },
                  {
                    name: "Name 7",
                    mobile: 9000000007,
                    address: "Address 7",
                  },
                ]}
              />
            }
          />
          <Route
            path="/card"
            element={<CardN name="STAR" mobile="1122334455" />}
          />
        </Routes>
        {/* BASIC GRID IS HOME PAGE GRID  */}
        <BasicGrid />
        {/* footer start  */}
        <Copyright sx={{ mt: 31 }} />
        {/* footer end  */}
      </Router>
    </div>
  );
}
export default App;
